// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface Elevator {
    function goTo(uint _floor) external;
}


contract Building {
    uint public callOne;
    bool public callTwo;

    function falseReturn() public pure returns (bool) {
        return false;
    }

    function isLastFloor(uint _a) public returns (bool) {
        // first call = false
        if (callTwo) {
            return true;
        } else {
            callTwo = true;
            return false;
        }

        // second call equals true.
    }

    function callGoTo(address _addr, uint _floor2) public {
        Elevator elevator = Elevator(_addr);
        elevator.goTo(_floor2);
    }
}

